(103, 29, 'Should I buy an X-box, just for the Kinect system?', 205, 206, NULL, NULL, 'I have been looking at getting an X-box because I have played the Kinect system at my cousin''s house and it seems really fun. Is this something I should invest in or should I just stick with the Wii?', 4, NULL, '2011-01-15 02:30:34', NULL, '2011-01-15 00:00:00', '0', '0', NULL, '0', 1),
