(109, 29, 'Buy the Droid X?', 217, 218, NULL, NULL, 'I have the Lg Ally and I love my phone, but I am considering upgrading to the Droid X, because it has more features and offers better application downloads. So should I go with the Droid X or stick with the Ally?', 4, NULL, '2011-01-15 02:34:22', NULL, '2011-01-20 00:00:00', '0', '0', NULL, '0', 1),
(110, 29, 'Should I buy an X-box, just for the Kinect system?', 219, 220, NULL, NULL, 'I have a Wii and I love how it requires you to actually move. But recently I have seen the X-box has come out with Kinect for it''s system which is similar to how the Wii system works, but with better graphics. So should I get the X-box and Kinect system or should I just stick with the Wii?', 5, NULL, '2011-01-15 02:40:19', NULL, '2011-01-20 00:00:00', '0', '0', NULL, '0', 1),
(111, 31, 'Should I go to class today?', 221, 222, NULL, NULL, 'This morning is the first day back to MBA school following winter break.  I''m tired, worn out by the weather,  should I go?', 1, NULL, '2011-01-15 05:44:37', NULL, '2011-01-15 07:00:00', '0', '0', NULL, '0', 1),
